script: |
  super -f text -I q10394.spq | sort > q10394.out

inputs:
  - name: q10394.spq
    data: |
      SELECT DISTINCT + + col0 + - 55 - col0 / col1 + 20 AS col2, - col0 * - - 7 AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q10394.out
    data: |
      -20	-105
      -35	-679
      48	-609
